import React, { Component } from 'react'

class Welcome extends Component{
    constructor(){
        super()
        this.state = {
            message: 'Hello Acey'
        }
    }

    render(){
        return (
            <div>
                <h1>{this.state.message}</h1>
            </div>
        )
    }
}

export default Welcome;
